import React, {useEffect,useState} from "react";

const Background = () => {

  const [backimage,setData] = useState([])

  function backgroundImage(city) {
    fetch(`https://picsum.photos/v2/list?page=2&limit=100`)
      .then((backimage) => {
        return backimage.json();
        console.log(backimage);
        setData(backimage);
      })
      .then(showbackimage);
  }

  useEffect(()=>{
    backgroundImage();
  },[]);

  function showbackimage(backimage) {
    console.log(backimage);
  }
    
}

export default Background
